import React, { useEffect, useState } from 'react'

import {Event,Description,People,WeekendSharp} from "@material-ui/icons"

import Calendar from 'react-calendar';

import {
    Alert,
    AlertIcon,
    AlertTitle,
    AlertDescription,
    CloseButton,
    useDisclosure,
  } from '@chakra-ui/react'


  import TimePicker from 'react-time-picker';

  import Select from 'react-select'



const StoreEvent = () => {

    const [error, setError] = useState({
        status: false,
        msg: "",
        type: "",
        desc:"",
      })

      const options = [
        { value: 'chocolate', label: 'Chocolate' },
        { value: 'strawberry', label: 'Strawberry' },
        { value: 'vanilla', label: 'Vanilla' }
      ]
      


    const {
        isOpen: isVisible,
        onClose,
      } = useDisclosure({ defaultIsOpen: true })

      const [value, onChange] = useState('10:00');

      const [value1, onChange1] = useState('10:00');

      const [value2, onChange2] = useState(new Date());


      const [week , setWeek]= useState(options.label);
      const handleSubmit=(e)=>{
        e.preventDefault() 

        console.log(week);

      }
      const handlChange=(e)=>{

        setWeek(e.label);
        

      }
      

      useEffect(()=>{
        const inputs = document.querySelectorAll(".input");
    
    
        function addcl(){
            let parent = this.parentNode.parentNode;
            parent.classList.add("focus");
        }
        
        function remcl(){
            let parent = this.parentNode.parentNode;
            if(this.value === ""){
                parent.classList.remove("focus");
            }
        }
        
        
        inputs.forEach(input => {
            input.addEventListener("focus", addcl);
            input.addEventListener("blur", remcl);
        });
        
        
       })


  return (
   
    <>
    <div className='container'>
    <div className="login-content">
    <form onSubmit={handleSubmit} >
    
    <div className="input-div one">
        <div className='i'>
  
        <Event/>
       
  
        </div>
        
        <div className='div'>
             <h5>Event Name</h5>
             <input className='input' type="text" name="event_name"  />
  
        </div>
    </div>
    <div className="input-div one">
        <div className='i'>
  
        
        <Description/>
  
        </div>
        
        <div className='div'>
             <h5>Event Description</h5>
             <input className='input' type="text" name='event_description' />
  
        </div>
    </div>
  
               <div className="input-div pass">
                        <div className="i"> 
                           <People/>
                        </div>
                        <div className="div">
                             <h5>Event Organizer Name</h5>
                             <input type="text" className="input" name='user_name'/>
                     </div>
                  </div>

                  <div className="pass lola">

                  <h5>Select Day Of Weeks</h5>
                        
                  <Select options={options} onChange={handlChange}/>
                  

                  </div>

                  <div className="pass lola">
                        
                  <span><h5>Start Time</h5></span><TimePicker onChange={onChange} value={value} />
                  </div>

                  <div className="pass lola">
                        
                  <span><h5>End Time</h5></span><TimePicker onChange={onChange1} value={value} />
                  </div>

                  <div className="pass lola">
                        
                  <Calendar onChange={onChange2} value={value2} />
                  </div>

                 
  
                  
  
                 
                  <input type="submit" class="btn" value="Submit"/>
  
    
    </form>


  
  
    </div>
    {error.status ?
    <div>
           <Alert status={error.type}>
  <AlertIcon />
  <AlertTitle>{error.msg}</AlertTitle>
  <AlertDescription>{error.desc}</AlertDescription>
  <CloseButton
        alignSelf='flex-start'
        position='relative'
        right={-1}
        top={-1}
        onClick={onClose}
      />
</Alert>
    </div>
    : ''}
  
  
    </div>
    </>
  )
}

export default StoreEvent
